      monster1: {
        name: 'Linda'
      },
      moonster2: {
        name: 'Frank'
      },
      monster3:{
        name: 'Bonny'
      }
    }
  }

  render() {

    return (
      <div className="App">
        <h1>this.state.monster1.name</h1>
        <h1>this.state.monster2.name</h1>
        <h1>this.state.monster3.name</h1>

      </div>
    );
    }
  }


export default App;
